function updateAvailableSeatsDD(n){$("#Seats").html("");$.each(n,function(n,t){$("#Seats").append($("<option><\/option>").val(t.id).html(t.seatNumber))})}function FillSeats(){var n=$("#Events").val();$.ajax({url:"/Events/GetSeats",type:"GET",dataType:"json",data:{eventId:n},success:function(n){var t=n.seats,i=n.userSeats;console.warn(n);$("#message").html(i);updateAvailableSeatsDD(t)}})}function SaveSeat(){var n=$("#Events").val(),t=$("#Seats").val(),i=$("#email").val(),r=$("#attendeeName").val();$.ajax({url:"/Events/SaveSeat",type:"POST",dataType:"json",data:{eventId:n,seatId:t,email:i,attendeeName:r},success:function(n){console.warn(n);updateAvailableSeatsDD(n.seats);$("#message").html(n.userSeats);$("#seats-selected").html(n.bookedSeats)}})}